import React from 'react'


const Table = ({ clients }) => {


  const result = clients.map((client) => {
    return client.forEach((c) => {
      return <td>{c}</td>
    })
  })

  // const bodyResult = bodyTitle.map((el, index) => {
  //   return <tr key={index}>
  //     <td><input type="checkbox" /></td>
  //     {
  //       el.map((e) => {
  //         return <td key={e.id} className={`TD-${e.id} ${e.state}`}>{e.title}</td>
  //       })
  //     }
  //   </tr>
  // })


  return (
    <div style={{ overflow: "auto" }}>
      <table className='table-dashboard table-main' >
        <thead>
          <tr>
            <th><input type="checkbox" /></th>
            <th>#</th>
            <th>رقم الطلب</th>
            <th>اسم العميل</th>
            <th>تاريخ الطلب</th>
            <th>الدفع</th>
            <th>الشحن</th>
            <th>المجموع</th>
            <th>حالة الطلب</th>
          </tr>
        </thead>
        <tbody>
          {result}
          <tr>
            <td className='table-more' colSpan="9">
              <a href='#' >المزيد من الطلبات</a>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  )
}

export default Table;
